import img2 from "../../../assets/sliderImag2.jpg";
import img3 from "../../../assets/sliderImag3.jpg";
import img4 from "../../../assets/sliderImag4.jpg";
import img5 from "../../../assets/sliderImag5.jpg";

const Services = () => {

    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
